import React, {Component} from 'react'

export default class Navbar extends Component {
render(){
    return(
        <div>
           <div class="topnav" id="myTopnav">
                <a href="#home" class="active">Home</a>
                    <a href="#news">News</a>
                    <a href="#contact">Contact</a>
                    <a href="#about">About</a>                  
            </div>
        </div>
    )
}

}
